import React from "react";
import "./Footer.css";

const Footer: React.FC = () => {
  return (
    <footer>
      <button>Contact Us</button>
      <button>Term of Use</button>
      <button>Privacy Policy</button>
    </footer>
  );
};

export default Footer;
